(426, '笑話', '一個弟弟在學校聽到一個八卦消息說：每一個大人至少都會有一個不可告人的秘密，只要用一句：「告訴你，我知道整件事情的真相ㄡ！」\n就可以把他們給唬住～即使你跟本就甚麼也不知道..\n放學後回到家裡，弟弟一遇到媽媽便說：\n「媽我告訴你，我知道整件事情的真相ㄡ！」\n他媽媽一聽到他這麼說，就趕緊塞給他20塊大洋，並叫他不可以告訴爸爸。\n看到媽媽會如此反應，弟弟覺得很高興，就在他爸爸下班回來時，迫不及待地跟爸爸說：「爸我告訴你，我知道整件事情的真相ㄡ！」\n果然爸爸一聽到他這麼說，也塞給他40塊大洋，並叫他不可以告訴媽媽！\n隔天一早，弟弟要上學時在門口遇到郵差先生送信。\n弟弟立刻開口說：「郵差叔叔，我告訴你，我知道整件事情的真相ㄡ！」\n只見郵差露出不敢置信的表情，然後張開手臂向他說：「原來你都知道了，乖ㄡ～來給爸爸抱抱！....」', 'autoLearn', 'autoLearn', NULL, 5, '2020-02-10 08:28:09', '2020-02-04 04:26:04'),
(427, '笑話', '話說三國時代,曹操領十萬大軍攻打劉備;張飛領三千軍出迎,\n對恃於長江兩岸.因距離遠,只能打手勢溝通.........\n\n曹操伸出右手比了個一,\n張飛也伸出右手比了個三,\n曹操繼而伸出十指晃了兩晃,\n張飛就雙手拍拍大腿,\n曹操就退兵了..........\n\n回去之後..............\n\n曹操的部將就問曹操:敵兵勢弱,丞相因何退兵?\n曹操曰:吾語張飛曰:吾欲一統山河.張飛卻答\'欲三分天下\'.\n吾又語之曰:吾有十萬大軍.張飛卻答\'放馬過來\'.\n張飛素來有勇無謀,此次竟敢以寡擊眾,必有諸葛亮埋伏設計.\n吾因而退兵.\n眾將然若.\n\n劉備也問張飛:曹操因何退兵?\n張飛說:我也不知道.\n曹操問我一天能做幾次,我就跟他說\'三次\'.\n然後他又問我十次怎麼樣,我就跟他說\'這樣就腿軟了\'.', 'autoLearn', 'autoLearn', NULL, 4, '2020-02-10 08:28:09', '2020-02-04 04:29:41'),
